import Layout from '../components/Layout';


const About =() => (
    <Layout>
        <div>
            <h1>About BitzPrice</h1>
            <p>Hello World Application to test using Next.JS for REACT server side rendered applications. BitzPrice allows you to view Bitcoin prices with the coindesk API.</p>
        </div>
    </Layout>
)

export default About;
